  \"Continuing studies of mortality of alligators on central Florida lakes : Pathology
  and nutrition : Final report to St. Johns River Water Management District\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 13,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:43:33.576692\",\n\t\"name\": \"continuing-studies-of-mortality-of-alligators-on-central-florida-lakes-pathology-and-nutri\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Investigations into the continuing, unexplained
  mortality of alligators on Lake Griffin in central Florida were conducted. Lake
  Griffin was surveyed for dead alligators every two weeks throughout the year and
  field work on dead and impaired alligators conducted February u2013 September, 2001.
  Seventy five dead alligators were recorded in 2001 and a mortality peak during the
  spring months March u2013 May was confirmed. Field evaluation of behavioral impairment
  indicated an average of 1% of alligators in Lake Griffin may be affected. Twelve
  impaired alligators and eight apparently healthy alligators from Lake Griffin and
  six alligators from other lakes were examined by necropsy for pathology, blood chemistry
  and histology. No significant findings were noted in gross pathology, blood chemistry
  or histology except for the following. Results from laboratory analyses of cholinesterase
  reactivation indicated no significant exposure to organophosphates in Lake Griffin
  or Lake Woodruff alligators. The relationship between blue green algae blooms, blue
  green algae toxicity, thiaminase production in gizzard shad, gizzard shad in alligator
  diets and thiamin deficiency in alligators is proposed for detailed additional study.\",\n\t\"license_title\":
